# 1895 Rutgers Queensmen football team

The 1895 Rutgers Queensmen football team represented Rutgers University as an independent during the 1895 college football season. William Ayres Reynolds coached the first two games, losing both. When Reynolds left to coach the Sewanee team, Rutgers completed their season under head coach H. W. Ambruster. The Queensmen compiled an overall 3â€“4 record and were outscored by their opponents, 131 to 98. The team captain was William A. Ranney.
